  false,\n\t\"url\": null,\n\t\"notes\": \"Marine toxic substance and other data were
  collected from bottle casts from NOAA Ship DISCOVERER from 07 May 1979 to 18 July
  1979. Data were collected by the Pacific Marine Environmental Laboratory (PMEL)
  as part of the Outer Continental Shelf Environmental Assessment Program (OCSEAP).
  Data were processed by NODC to the NODC standard F144 Marine Toxic Substances format.
  Full format description is available from NODC at www.nodc.noaa.gov/General/NODC-Archive/f144.html.
  An analog file for this accession is available from NODC user services.nnThe F144
  format contains data on ambient concentrations of toxic substances and other pollutants
  in the marine environment. The data derive from laboratory analyses of samples of
  water, sediment, or marine organisms. Samples may have been collected near marine
  discharge sites or during ocean monitoring surveys of large areas. Field observations
  of tar deposits on beaches may also be reported. Survey information includes platform
  type, start and end dates, and investigator and institution. If data are collected
  near a discharge site, discharge location, depth, distance to shore, average volume,
  and other characteristics are reported. Position, date, time and environmental conditions
  are reported for each sample station. Environmental data may include meteorological
  and sea surface conditions, tide stage and height, depth of the thermocline or mixed
  layer surface temperature and salinity, and wave height and periods. Sample characteristics,
  collection methods, and laboratory techniques are reported for each sample collected
  and analyzed. The data record comprises concentration values (or a code to indicate
  trace amounts) for each chemical substance analyzed. Chemical substances are identified
  by codes based on the registry numbers assigned by the Chemical Abstracts Service
  (CAS) of the American Chemical Society. Marine organisms from which samples have
  been taken are identified using the 12-digit NODC Taxonomic Code. A text record
  is available for optional comments.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
